import CategoryItem from '../item/CategoryItem'

const ListCategory = () => {
  const numbers = [1, 2, 3, 4, 5]
  const listItems = numbers.map((number) =>
    <CategoryItem props={number} />
  )
  return (
    <section className="category-list">
      {listItems}
    </section>
  )
}

export default ListCategory
